# encoding: utf-8
module AddressGenerator

  def self.generate
    gender = GENDERS.shuffle.first
    city = CITIES[rand(CITIES.length)]
    firstname = FIRSTNAMES[gender][rand(FIRSTNAMES[gender].length)]
    lastname  = LASTNAMES[rand(LASTNAMES.length)]
    email = "#{firstname.parameterize}.#{lastname.parameterize}@tauschrausch.com".downcase
    {
      gender:    gender,
      firstname: firstname,
      lastname:  lastname,
      street:    "#{STREETS[rand(STREETS.length)]} #{rand(100)+1}",
      zip_code:  city.first,
      city:      city.last,
      phone:     "0#{rand(99999)}-#{rand(999999)}",
      mobilephone: "01#{rand(9999)}-#{rand(999999)}",
      email:     email
    }
  end

